// src/Pages/Admin/AllUsers.js
import React, { useEffect, useState } from "react";
import api from "../../axiosConfig"; // make sure this points to your axios config
import { useNavigate } from "react-router-dom";
import "./AllUsers.css";

const AllUsers = () => {
  const navigate = useNavigate();
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/AdminLogin");
      return;
    }

    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const res = await api.get(""); // API endpoint
      setUsers(res.data || []);
      setLoading(false);
    } catch (err) {
      console.error(err);
      setError("Failed to load users");
      setLoading(false);
    }
  };

  if (loading) return <p className="info-msg">Loading users...</p>;
  if (error) return <p className="error-msg">{error}</p>;

  return (
    <div className="allusers-container">
      <header className="allusers-header">
        <h2>All Registered Users</h2>
      </header>

      <main className="allusers-content">
        {users.length === 0 ? (
          <p>No users found.</p>
        ) : (
          <table>
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Username</th>
                <th>Role</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user) => (
                <tr key={user.id}>
                  <td>{user.id}</td>
                  <td>{user.name}</td>
                  <td>{user.userName}</td>
                  <td>{user.role}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </main>
    </div>
  );
};

export default AllUsers;
